import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Dimensions } from "react-native-web";

const { width, height } = Dimensions.get("window");

const App = () => {
  return (
    <Box
      w={width * 0.8}
      h={height * 0.6}
      position="fixed"
      top="1/2"
      borderWidth="1"
    >
      <Text>FA</Text>
    </Box>
  );
};

export default App;
